import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './HomePage';
import AcademicPrograms from './academicprogram';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/academics" element={<AcademicPrograms />} />
        <Route path="/admissions" element={<div>Admissions Page - Coming Soon</div>} />
        <Route path="/news" element={<div>News & Events Page - Coming Soon</div>} />
        <Route path="/downloads" element={<div>Downloads Page - Coming Soon</div>} />
      </Routes>
    </Router>
  );
}

export default App;
